import React, { Component } from 'react'
import PropTypes from 'prop-types'
import Link from 'next/link'

export default class extends Component {
  constructor (props) {
    super(props);
    this.state = {
        ...this.props
    };
  }

  componentDidMount() {}

  failure() {
      return('Invalid input')
  }

  success() {
    return (
        <div>
            <div>Here goes the result</div>
            <h2>SOMETHING</h2>

            <Link href='answer' as={ "/answer/1" }>
            <button>Go to Reasoning</button>
            </Link>
        </div>
    )
  }

  render() {
      return(this.success())
  }
}
